import React from 'react';
import './App.css';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';
import Category from './Category';

function App() {
  return (
    <>
      <div className="appHeader">
           <ArrowBackIcon /> 
          <h1>Categories</h1>
      </div>
      <div className="categories">
          <Category 
              image="https://img.pngio.com/business-woman-transparent-png-stickpng-business-woman-png-230_352.png"
              title="Women"
          />
          <Category 
              image="https://lh3.googleusercontent.com/proxy/y0hq-NYNIQ4UhNl9lea9tneh4eHSXa1XAyRzf2C9V_RmEHV-R2wZ6MbizyOVvZ3gkjjEwCryUZfiq5-zijk7lUAni0RIkd8FwBbkW1xT8UM"
              title="Men"
          />
      </div>
    </>
  );
}

export default App;
